</template>
<script>
import {DownOutlined, LoadingOutlined, SearchOutlined, DeleteOutlined} from '@ant-design/icons-vue'
import {Input, Modal, notification, Select, SelectOption, RadioGroup, Radio, Row, Col, Tooltip} from "ant-design-vue"
import OptionsSettingItem from "./options_setting_item.vue"
import ReviewBanner from "./reviewBanner.vue"
import WebinarBanner from './webinarBanner.vue'
import axios from "axios"
import _, {debounce} from "lodash"
import Fuse from 'fuse.js'

export default {
    props: {
        is_has_plan_collection:Boolean,
        closeMakeSure: Boolean
    },
    data() {
        return {
            store_id: 0,
            store_name: '',
            searchSelect: 'inList',
            modalUploadSwatch: false,
            isLoading: false,
            editOption: '',
            data_img: [],
            temp_list_option_data_img: [],
            list_option: [],
            list_option_data_img: [],
            search_query: "",
            search_query_option: "",
            list_option_search: [],
            isResultSearch: false,
            isFindSearchResult: true,
            isShowNoData: false,
            list_result_search: [],
            temp_data_img: [],
            checkAddOption: false,
            isNullUploadSwatch: false,
            original_list_option: [],
            original_list_option_data_img: [],
            store_url: '',
            discardState: false,
            isSearchLoading: false,
            modalDisplaySetting: false,
            display_setting_swatch: "above",
            origin_display_setting_swatch: 'above',
            temp_display_setting_swatch: '',
            scrollPosition: 0,
            searchEditOptionList: [],

        }
    },
    created() {
        this.store_name = window.pv_settings.store_name
        this.store_id = window.pv_settings.store_id
    },
    unmounted() {
        document.getElementById('pv-main-container').removeEventListener('scroll', this.handleScrollOptionConfigure);
    },
    async mounted() {
        this.store_url = window.pv_settings.store_url
        this.isLoading = true
        try {
            document.getElementById('pv-main-container').addEventListener('scroll', this.handleScrollOptionConfigure);
        } catch (error) {
        }
        this.trackClickOutsideBlock('pv-search', "pv-search-result", 'isResultSearch')
        axios.post("/pv/fetch_variant", {
            jsonrpc: 2,
            params: {store_url: this.store_url, referer: window.location.href}
        }).then(res => {
            if (res.data.result.code === 1) {
                this.display_setting_swatch = JSON.parse(JSON.stringify(res.data.result.display_setting_swatch))
                this.origin_display_setting_swatch = JSON.parse(JSON.stringify(res.data.result.display_setting_swatch))
                this.isLoading = false
                this.list_option = res.data.result.list_option
                this.list_option_data_img = res.data.result.list_option_data_img
                this.temp_list_option_data_img = this.list_option_data_img.map(object => ({...object}))
                this.original_list_option = JSON.stringify(this.list_option)
                this.original_list_option_data_img = JSON.stringify(this.list_option_data_img)
                this.$emit('returnPaidFeatureVariable', res.data.result.is_has_plan_collection,res.data.result.is_has_plan_product_groups)
            }
            if (res.data.result.code === -1) {
                this.isLoading = false
                this.show_toast("error", "Something went wrong. Please contact the customer support.")
                console.log(res.data.result.exception)
            }
        }).catch(error => {
            this.isLoading = false
            console.log(error)
        })
    },
    watch: {
        isOptionChange() {
            this.$.emit('checkOptionChange', this.isOptionChange)
        },
        search_query_option: _.debounce(async function (newone) {
            let fuseOptions = {
                keys: ['value'],
                threshold: 0.25,  // Adjust the threshold for fuzziness (0 - exact match, 1 - match all)
            };
            this.searchEditOptionList = JSON.parse(JSON.stringify(this.editOption.values.list_value))
            if (newone !== '') {
                let fuse = new Fuse(this.editOption.values.list_value.map(value => ({value})), fuseOptions);
                let results = fuse.search(newone);
                this.searchEditOptionList = results.map(result => result.item.value);

            }
        }, 200),
    },
    emits: ['checkOptionChange', 'setLoadingData'],
    components: {
        Tooltip,
        ReviewBanner, Row, Col,
        SearchOutlined,
        Input, WebinarBanner,
        Modal,
        Select,
        SelectOption,
        OptionsSettingItem,
        LoadingOutlined,
        DownOutlined,
        RadioGroup,
        Radio,
        DeleteOutlined
    },
    methods: {
        handleScrollOptionConfigure(event) {
            this.scrollPosition = event.target.scrollTop
        },
        applyDisplaySetting() {
            this.display_setting_swatch = JSON.parse(JSON.stringify(this.temp_display_setting_swatch))
            this.modalDisplaySetting = false
        },
        openModalDisplaySetting() {
            this.modalDisplaySetting = true
            this.temp_display_setting_swatch = JSON.parse(JSON.stringify(this.display_setting_swatch))
        },
        validateColorCode(color_code) {
            const regex = /^#?([a-fA-F0-9]{6}|[a-fA-F0-9]{3})$/
            return regex.test(color_code)
        },
        deleteImage(item) {
            for (let e of this.temp_list_option_data_img) {
                if (item.variant_option_name === e.variant_option_name && item.variant_option_value === e.variant_option_value) {
                    delete e.imgData
                    delete e.imgName
                    e.upload_img_url = ''
                }
            }
        },
        isValidUrl(item) {
            item.isValidUrl = /(https?|ftp):\/\/[a-zA-Z0-9@:%._\\+~#?&//=]{2,256}\.[a-z]{2,63}\b([-a-zA-Z0-9@:%"+~#?&//=]*)?/.test(item.swatch_img_url)
            return /(https?|ftp):\/\/[a-zA-Z0-9@:%._\\+~#?&//=]{2,256}\.[a-z]{2,63}\b([-a-zA-Z0-9@:%"+~#?&//=]*)?/.test(item.swatch_img_url)
        },
        selectDisplayStyle(emit_option, value) {
            for (let option of this.list_option) {
                if (option.name === emit_option.name) {
                    option.display_style = value
                }
            }
        },
        selectDisplayStyleCollectionPage(emit_option, value) {
            for (let option of this.list_option) {
                if (option.name === emit_option.name) {
                    option.display_type_collection_page = value
                }
            }
        },
        selectOptionImages(emit_option, value) {
            for (let option of this.list_option) {
                if (option.name === emit_option.name) {
                    option.option_img = value
                }
            }
        },
        selectOptionSearch(product) {
            for (let search_product_variant_option of product.variant_options) {
                let list_temp_data = []
                for (let temp_value of search_product_variant_option.values) {
                    list_temp_data.push(temp_value)
                }
                let data_temp = {
                    name: search_product_variant_option.name,
                    values: {list_value: list_temp_data},
                    display_style: "swatch_circle_in_square",
                    display_type_collection_page: "swatch_circle_in_square",
                    option_img: "variant_image"
                }
                if (!this.list_option.filter(e => e.name === data_temp.name).length > 0) {
                    this.list_option.unshift(data_temp)
                    for (let value of data_temp.values.list_value) {
                        this.list_option_data_img.push({
                            variant_option_value: value,
                            color_code: '#ffffff',
                            swatch_img_url: '',
                            variant_option_name: data_temp.name,
                            store_id: this.list_option_data_img[0].store_id,
                            upload_img_url: '',
                            option_swatch: 'color'
                        })
                    }
                    this.checkAddOption = true
                } else {
                    for (let option of this.list_option) {
                        if (option.name === data_temp.name) {
                            for (let value of data_temp.values.list_value) {
                                if (!option.values.list_value.filter(e => e === value).length > 0) {
                                    option.values.list_value.push(value)
                                    this.list_option_data_img.push({
                                        variant_option_value: value,
                                        color_code: '#ffffff',
                                        swatch_img_url: '',
                                        variant_option_name: data_temp.name,
                                        store_id: this.list_option_data_img[0].store_id,
                                        upload_img_url: '',
                                        option_swatch: 'color'
                                    })
                                    this.checkAddOption = true
                                }
                            }
                        }
                    }
                }
            }

            if (this.checkAddOption) {
                this.show_toast("success", 'You have added option(s)')
                this.checkAddOption = false
            } else {
                this.show_toast("success", `Option(s) and variant(s) of "${product.product_title}" added to list. If button Save is displayed, please click Save to save them!`, 3)
            }
            this.list_option_search = []
        },
        trackClickOutsideBlock: function (parentElement, block_id, state) {
            document.addEventListener('click', (event) => {
                const parent_element = document.getElementById(parentElement)
                const clickedElement = event.target
                if (parent_element !== null) {
                    if (!parent_element.contains(clickedElement)) {
                        const targetBlock = document.getElementById(block_id)
                        if (targetBlock) {
                            if (!targetBlock.contains(clickedElement)) {
                                if (this[state] === true) {
                                    this[state] = false
                                    this.search_query = ''
                                    this.list_result_search = []
                                }
                            }
                        }
                    }
                }
            })
        },
        handleChangeOptionSearch() {
            this.list_option_search = []
            this.search_query = ''
            if (this.searchSelect === 'inStore') {
                this.isShowNoData = false
            }

        },
        searchHandleKeyUp() {
            this.isFindSearchResult = true
            this.isShowNoData = false
            this.list_result_search = []
            this.list_option_search = []
        },
        searchHandle: debounce(function () {
            if (this.searchSelect === 'inStore') {
                this.list_result_search = []
                if (this.search_query) {
                    this.isSearchLoading = true
                    axios.post("/pv/fetch_variant", {
                        jsonrpc: 2, params: {
                            store_url: this.store_url,
                            product_name: this.search_query,
                            referer: window.location.href
                        }
                    }).then(res => {
                        if (res.data.result.code === 1) {
                            if (res.data.result.list_option !== 0) {
                                this.isResultSearch = true
                                this.isFindSearchResult = true
                                this.list_result_search = res.data.result.list_option
                            } else {
                                this.isFindSearchResult = false
                                // this.show_toast("warning", `There are no products containing the character "${this.search_query}".`)
                            }
                        }
                        this.isSearchLoading = false
                    }).catch(error => {
                        console.log(error)
                    })
                }
            }
            if (this.searchSelect === 'inList') {
                this.list_option_search = []
                if (this.search_query === '') {
                    this.list_option_search = []
                    this.isShowNoData = false
                } else {
                    for (let option of this.list_option) {
                        if (option.name.toLowerCase().includes(this.search_query.toLowerCase())) {
                            this.list_option_search.push(option)
                        }
                    }
                    if (this.list_option_search.length === 0) {
                        this.isShowNoData = true
                        // this.show_toast("warning", `There are no options containing the character "${this.search_query}".`)
                    }
                }
            }
        }, 500),
        show_toast: function (type, message, duration = 3) {
            let background = ''
            if (type === 'success') {
                background = '#52c41a'
            } else if (type === 'error') {
                background = '#F5222D'
            } else {
                background = '#E9A317'
            }
            notification[type]({
                message: message,
                duration: duration,
                placement: 'bottomRight',
                style: {
                    backgroundColor: background,
                }
            })
        },
        uploadSwatch() {
            let count = 0
            let countIsInValidUrl = 0
            let countIsInValidColorCode = 0
            for (let option_data_img of this.temp_list_option_data_img) {
                if (option_data_img.variant_option_name === this.editOption.name) {
                    for (let variant of this.editOption.values.list_value) {
                        if (variant === option_data_img.variant_option_value && option_data_img.option_swatch === 'upload' && option_data_img.upload_img_url === '' && !('imgName' in option_data_img)) {
                            this.isNullUploadSwatch = true
                            break
                        }
                        if (variant === option_data_img.variant_option_value && option_data_img.option_swatch === 'add_url' && option_data_img.swatch_img_url === '') {
                            this.isNullUploadSwatch = true
                            break
                        }
                        if (variant === option_data_img.variant_option_value && option_data_img.option_swatch === 'color') {
                            count += 1
                        }
                        if (variant === option_data_img.variant_option_value && option_data_img.option_swatch === 'add_url' && option_data_img.swatch_img_url !== '') {
                            count += 1
                        }
                        if (variant === option_data_img.variant_option_value && option_data_img.option_swatch === 'upload' && option_data_img.imgName !== '') {
                            count += 1
                        }
                    }
                    if (count === this.editOption.values.list_value.length) {
                        this.isNullUploadSwatch = false
                    }
                }
                if ('isValidUrl' in option_data_img && !option_data_img.isValidUrl && option_data_img.option_swatch === "add_url") {
                    countIsInValidUrl += 1
                }
                if (option_data_img.option_swatch === 'color' && !this.validateColorCode(option_data_img.color_code)) {
                    countIsInValidColorCode += 1
                }
            }
            if (this.isNullUploadSwatch) {
                this.show_toast('error', 'Field(s) must not be blank!')
            } else {
                if (countIsInValidColorCode > 0) {
                    this.show_toast('error', 'Invalid color code!')
                }
                if (countIsInValidUrl > 0) {
                    this.show_toast('error', 'Invalid image URL!')
                }
                if (countIsInValidColorCode === 0 && countIsInValidUrl === 0) {
                    this.list_option_data_img = this.temp_list_option_data_img.map(object => ({...object}))
                    this.editOption = ''
                    this.modalUploadSwatch = false
                    this.search_query_option = ''
                    this.show_toast('success', "Swatch of color variant has been updated successfully. Please save your edits to apply.")
                }
            }
        },
        openModalUploadSwatch(value, option) {
            this.temp_list_option_data_img = this.list_option_data_img.map(object => ({...object}))
            this.modalUploadSwatch = value
            this.editOption = option
            this.searchEditOptionList = option.values.list_value
        },
        closeUploadSwatch() {
            this.temp_list_option_data_img = this.list_option_data_img.map(object => ({...object}))
            this.editOption = ''
            this.modalUploadSwatch = false
            this.search_query_option = ''
            this.isNullUploadSwatch = false
        },
        handleFileChange(variant, item) {
            let temp_event = event
            let file = event.target.files[0] || event.dataTransfer.files[0]
            let temp_data
            if (file.size > 5242880) {
                this.show_toast('error', 'The image size must be less than 5MB')
                return
            }
            if (!file) return
            var reader = new FileReader()
            reader.readAsDataURL(file)
            reader.onload = (e) => {
                temp_data = {
                    variant_value: variant,
                    imgName: temp_event.target.files[0].name || temp_event.dataTransfer.files[0],
                    imgData: e.target.result
                }
                item.imgData = temp_data.imgData
                item.imgName = temp_data.imgName
                if (this.temp_data_img.length > 0) {
                    let index = -1
                    for (let i = 0; i < this.temp_data_img.length; i++) {
                        if (this.temp_data_img[i].variant_value === temp_data.variant_value) {
                            index = i
                        }
                    }
                    if (index !== -1) {
                        this.temp_data_img[index].imgName = temp_data.imgName
                        this.temp_data_img[index].imgData = temp_data.imgData
                    } else {
                        this.temp_data_img.push(temp_data)
                    }
                } else {
                    this.temp_data_img.push(temp_data)
                }
            }
        },
        saveVariantOptionsStyle() {
            // this.list_option_data_img = this.temp_list_option_data_img.map(object => ({...object}))
            this.editOption = ''
            this.modalUploadSwatch = false
            this.search_query_option = ''
            this.$emit('setLoadingData', true)
            axios.post("/pv/save_option_setting", {
                jsonrpc: 2, params: {
                    list_option: this.list_option,
                    store_url: this.store_url,
                    list_data_img: this.list_option_data_img,
                    referer: window.location.href,
                    display_setting_swatch: this.display_setting_swatch
                }
            }).then(res => {
                if (res.data.result.code === 1) {
                    this.display_setting_swatch = JSON.parse(JSON.stringify(res.data.result.display_setting_swatch))
                    this.origin_display_setting_swatch = JSON.parse(JSON.stringify(res.data.result.display_setting_swatch))
                    this.list_option_data_img = res.data.result.list_url_img
                    this.list_option = res.data.result.list_option
                    this.original_list_option = JSON.stringify(this.list_option)
                    this.original_list_option_data_img = JSON.stringify(this.list_option_data_img)
                    this.show_toast('success', "Option configuration has been saved successfully.")
                } else {
                    console.log(res.data.result.error)
                    this.show_toast("error", "Something went wrong. Please contact the customer support")
                }
                this.$emit('setLoadingData', false)
            }).catch(error => {
                this.$emit('setLoadingData', false)
                this.show_toast("error", "Something went wrong. Please contact the customer support")
                console.log(error)
            })
            this.discardState = !this.discardState
            this.list_option_search = []
            this.search_query = ''
            this.isShowNoData = false
        },
        cancelVariantOptionsStyle() {
            this.display_setting_swatch = JSON.parse(JSON.stringify(this.origin_display_setting_swatch))
            this.list_option = JSON.parse(this.original_list_option)
            this.list_option_data_img = JSON.parse(this.original_list_option_data_img)
            this.discardState = !this.discardState
            this.list_option_search = []
            this.search_query = ''
            this.isShowNoData = false
        }
    },
    computed: {
        isOptionChange() {
            return JSON.stringify(this.list_option) != this.original_list_option || this.original_list_option_data_img != JSON.stringify(this.list_option_data_img) || this.display_setting_swatch !== this.origin_display_setting_swatch
        }
    }
}
</script>